INSERT INTO `produtos` VALUES (1,1,'Picanha Maturada','Fatias generosas de picanha maturada, grelhadas à perfeição, com uma capa de gordura dourada e interior macio. Ideal para compartilhar em momentos especiais.','Nossa Picanha Maturada é selecionada e preparada para garantir o máximo de sabor e suculência. Servida em uma chapa quente para manter a temperatura, é o prato perfeito para 2 ou 4 pessoas. Acompanha guarnições clássicas que complementam a experiência. Sugestão: harmoniza perfeitamente com nossas cervejas especiais ou uma taça de vinho tinto.',197.90,'data:image/svg+xml;base64,','2025-07-22 06:18:08',4,1,1,2),(2,1,'Peito de Frango Grelhado','Peito de frango marinado em ervas finas, grelhado lentamente para um resultado suculento e cheio de sabor. Uma opção leve e deliciosa para dividir.','Para quem busca uma refeição mais leve sem abrir mão do sabor. Nossos filés de peito de frango são cuidadosamente temperados e grelhados, resultando em uma carne macia e aromática. O prato é servido em porção para 2 ou 4 pessoas e acompanha guarnições frescas. Ideal para um almoço em família ou um jantar agradável.',94.90,'data:image/svg+xml;base64,','2025-07-22 06:19:54',3,1,1,3),(3,1,'Carne de Sol','A autêntica Carne de Sol do sertão, dessalgada no ponto certo, macia e desfiando. Servida com a tradicional manteiga de garrafa para uma experiência nordestina completa.','Uma viagem aos sabores do Nordeste. Nossa Carne de Sol é preparada artesanalmente, garantindo uma textura inigualável. Servida em porção generosa para 2 ou 4 pessoas, acompanha mandioca cozida na manteiga e outras guarnições que realçam seu sabor único. É o prato ideal para quem aprecia a culinária regional brasileira.',169.90,'data:image/svg+xml;base64,','2025-07-22 06:27:15',2,1,1,0),(4,2,'Parmegiana de carne','Nosso exclusivo filé mignon à parmegiana, coberto com molho de tomate artesanal e um mix de queijos gratinados até dourar. Acompanha arroz branco e batatas fritas crocantes.','A Parmegiana Skina67 é a estrela da casa. Usamos um corte nobre de filé mignon, empanado em farinha panko para máxima crocância. O molho de tomate é feito aqui, com tomates frescos, e a combinação de queijos derretidos cria uma cobertura cremosa e irresistível. É o prato individual perfeito para quem busca conforto e muito sabor.',54.90,'data:image/svg+xml;base64,','2025-07-22 06:30:27',1,1,0,4),(5,3,'Trio Petisco','A combinação perfeita para sua mesa! Iscas de frango crocantes, rodelas de calabresa acebolada e batatas fritas sequinhas. Ideal para acompanhar seu drink.','Pensado para agradar a todos, nosso Trio Petisco reúne três clássicos de boteco em uma só porção. As iscas de frango são empanadas na farinha panko, a calabresa é refogada com cebola até ficar douradinha e as batatas são fritas no ponto certo. Serve bem de 2 a 3 pessoas e é a pedida certa para começar a noite.',69.90,'data:image/svg+xml;base64,','2025-07-22 06:33:17',3,1,1,5),(6,1,'Peito de Frango à Milanesa','Frango empanado, crocante por fora e macio por dentro, ideal para os fãs de sabor e textura.','Peito de frango empanado em farinha especial, frito até atingir uma crocância perfeita, mantendo o interior macio e suculento. Acompanha arroz branco soltinho, batata frita dourada e salada fresca. Uma opção irresistível!',109.90,'data:image/svg+xml;base64,','2025-07-23 01:21:07',2,1,1,4),(7,1,'Parmegiana de Frango','Frango empanado com molho de tomate e queijo gratinado, sabor caseiro e irresistível.','Clássico frango à parmegiana com peito empanado, molho de tomate fresco, cobertura de queijo derretido e gratinado no forno. Acompanha arroz branco e batata frita. Uma combinação perfeita que agrada todos os paladares.',99.99,'data:image/svg+xml;base64,','2025-07-23 01:23:21',2,1,0,1),(8,2,'Peito de Frango à Milanesa da Casa','Frango empanado crocante com sabor caseiro, ideal para o dia a dia.','Peito de frango empanado na farinha especial da casa, frito até ficar dourado e crocante. Acompanha arroz branco soltinho e batata frita. Uma opção simples, saborosa e perfeita para todas as idades.',44.90,'data:image/svg+xml;base64,','2025-07-23 01:27:15',1,1,0,8),(9,2,'Sobrecoxa','Sobrecoxa grelhada com tomate confit e mussarela derretida, cheia de sabor.','Sobrecoxa de frango desossada e grelhada, coberta com tomate confit e mussarela derretida. Acompanha arroz branco e fritas. Uma opção suculenta e sofisticada para quem aprecia um toque gourmet no dia a dia.',37.90,'data:image/svg+xml;base64,','2025-07-23 01:29:29',1,1,0,9),(10,2,'Tilápia da casa','Tilápia grelhada ao molho Alfredo com camarões, tomate cereja e purê de batata.','Filé de tilápia grelhado, regado ao molho Alfredo cremoso com base de parmesão, acompanhado de tomate cereja assado, camarões salteados e purê de batata cremoso. Uma refeição completa e sofisticada, perfeita para paladares exigentes.',49.90,'data:image/svg+xml;base64,','2025-07-23 01:31:27',1,1,0,10),(11,2,'Tilápia Crocante','Tilápia empanada na farinha panko com molho tártaro e acompanhamentos equilibrados.','Filé de tilápia empanado na crocante farinha panko, servido com molho tártaro artesanal, arroz branco, brócolis no vapor e purê de batata. Uma opção leve, crocante e deliciosa, que agrada tanto crianças quanto adultos.',45.90,'data:image/svg+xml;base64,','2025-07-23 01:32:40',1,1,0,11),(12,3,'Camarão ao Alho e Óleo 250g','Camarão salteado no alho e óleo, sabor clássico e intenso.','Camarões frescos preparados no alho e óleo, com tempero especial que realça o sabor marcante do fruto do mar. Uma opção deliciosa para quem ama petiscos sofisticados e cheios de personalidade.',64.90,'data:image/svg+xml;base64,','2025-07-23 01:35:11',2,1,1,12),(13,3,'Camarão Empanado','Camarões crocantes empanados com farinha de rosca e gergelim.','Camarões selecionados empanados na farinha de rosca com toque de gergelim, fritos até ficarem dourados e crocantes. Uma explosão de sabor em cada mordida, perfeito como entrada ou petisco para compartilhar.',89.90,'data:image/svg+xml;base64,','2025-07-23 01:36:25',2,1,1,13),(14,3,'Bolinha de Frango','Bolinhos de frango temperados, crocantes por fora e macios por dentro.','Deliciosas bolinhas feitas com frango desfiado e temperado, empanadas e fritas até ficarem douradas. Crocância por fora, cremosidade por dentro. Ideal para petiscar ou servir como entrada.',44.90,'data:image/svg+xml;base64,','2025-07-23 01:38:22',2,1,0,14),(15,3,'Bolinho de Cupim com Provolone','Bolinho recheado com cupim desfiado e queijo provolone derretido.','Massa crocante recheada com cupim cozido e desfiado lentamente, combinada com queijo provolone derretido. Sabor forte, textura macia e um toque defumado. Uma explosão de sabor em cada mordida.',59.90,'data:image/svg+xml;base64,','2025-07-23 01:40:01',2,1,0,15),(17,5,'Super Cheddar','Hambúrguer suculento com cheddar, cebola caramelizada e molho de picles no pão brioche.','Um hambúrguer irresistível servido no pão brioche fresquinho, com hambúrguer bovino, molho de picles artesanal, cebola caramelizada e uma generosa fatia de queijo cheddar derretido. Uma combinação cremosa e marcante que agrada a todos os paladares.',33.90,'data:image/svg+xml;base64,','2025-07-23 01:49:23',1,1,0,17),(18,5,'Super Salada','Hambúrguer com alface, tomate, queijo prado e molho da casa no pão brioche.','Para quem busca equilíbrio entre sabor e leveza: pão brioche fresquinho, hambúrguer bovino grelhado, alface crocante, tomate suculento, queijo prado e molho da casa. Uma opção completa, fresca e deliciosa.',27.90,'data:image/svg+xml;base64,','2025-07-23 01:50:28',1,1,0,18),(19,5,'Inesquecível','Hambúrguer especial com crispy de cebola, rúcula, tomate e molho da casa.','Uma explosão de sabor com hambúrguer bovino grelhado, pão brioche artesanal, tomate na parrilla, rúcula fresca, queijo prado, crispy de cebola e molho exclusivo. Um sanduíche sofisticado que faz jus ao nome: inesquecível!',29.90,'data:image/svg+xml;base64,','2025-07-23 01:52:42',1,1,0,19),(20,5,'Classic Burger','O clássico: hambúrguer, cheddar e molho da casa no pão brioche.','Pão brioche macio, hambúrguer bovino suculento, queijo cheddar derretido e molho da casa. Simples, direto e delicioso. O verdadeiro sabor do hambúrguer tradicional feito com qualidade.',26.90,'data:image/svg+xml;base64,','2025-07-23 01:54:49',1,1,0,20),(21,5,'Poderoso','Sanduíche duplo com bacon, cheddar e molho especial no brioche.','Um sanduíche de respeito: dois hambúrgueres bovinos grelhados, bacon crocante, queijo cheddar derretido e o maravilhoso molho da casa, tudo isso no pão brioche fresquinho. Sabor intenso, tamanho generoso e presença marcante.',39.90,'data:image/svg+xml;base64,','2025-07-23 01:56:00',1,1,0,21),(22,6,'Guaraná Zero','Refrigerante Guaraná Zero – leve, gelado e refrescante.','Delicioso refrigerante Guaraná Zero, perfeito para quem busca sabor com menos açúcar. Ideal para acompanhar qualquer refeição com uma bebida leve e geladinha.',7.90,'data:image/svg+xml;base64,','2025-07-23 02:08:10',1,1,1,22),(23,6,'Suco de Polpa – Copo 300ml','Suco gelado feito com polpa natural da fruta – 300ml.','Suco preparado com polpa natural de fruta, servido bem gelado em copo de 300ml. Opção refrescante, prática e saborosa para todas as ocasiões.',8.90,'data:image/svg+xml;base64,','2025-07-23 02:09:48',1,1,1,23),(24,6,'Suco Natural – Copo 300ml','Suco 100% natural da fruta – copo de 300ml.','Suco espremido direto da fruta, sem adição de conservantes. Perfeito para quem busca sabor autêntico e natural em cada gole. Servido em copo de 300ml.',9.90,'data:image/svg+xml;base64,','2025-07-23 02:10:58',1,1,1,24),(25,6,'Suco de Polpa – Jarra 700ml','Suco de polpa de fruta servido em jarra – ideal para compartilhar.','Suco refrescante preparado com polpa natural, servido em jarra de 700ml. Ideal para dividir ou matar a sede com muito sabor. Escolha sua fruta preferida!',17.90,'data:image/svg+xml;base64,','2025-07-23 02:12:13',3,1,0,25),(26,6,'Suco Natural – Jarra 700ml','Suco 100% natural servido em jarra de 700ml – sabor fresco e saudável.','Suco natural espremido da fruta, sem conservantes ou aditivos. Uma opção saudável e deliciosa servida em jarra de 700ml, perfeita para acompanhar refeições ou compartilhar à mesa.',19.90,'data:image/svg+xml;base64,','2025-07-23 02:13:26',3,1,0,26),(27,7,'Original 600ml','Cerveja Original 600ml – leve, refrescante e com sabor marcante.','A tradicional Cerveja Original, servida geladinha na garrafa de 600ml. Combina perfeitamente com petiscos e refeições. Seu sabor leve com amargor equilibrado agrada quem aprecia uma cerveja clássica.',14.90,'data:image/svg+xml;base64,','2025-07-23 02:15:19',2,1,1,27),(28,7,'Cerveja Brahma 600ml','Cerveja Brahma 600ml – puro malte com sabor suave e refrescante.','Uma das preferidas do Brasil! Brahma 600ml é ideal para quem busca uma cerveja leve e cremosa, com espuma consistente e sabor marcante. Ótima para acompanhar bons momentos.',12.90,'data:image/svg+xml;base64,','2025-07-23 02:16:29',2,1,1,28),(29,7,'Antarctica 600ml','Cerveja Antarctica 600ml – gelada, leve e fácil de beber.','Cerveja tradicional e acessível, perfeita para todos os gostos. Antarctica 600ml é refrescante, tem corpo leve e harmoniza bem com porções, churrascos ou encontros descontraídos.',10.90,'data:image/svg+xml;base64,','2025-07-23 02:18:08',2,1,1,29),(30,7,'Heineken 600ml','Cerveja Heineken 600ml – puro malte com sabor encorpado.','Cerveja premium feita com puro malte e lúpulo selecionado. Heineken 600ml tem sabor encorpado, amargor balanceado e aroma marcante. Uma escolha ideal para quem aprecia uma cerveja de qualidade superior.',18.90,'data:image/svg+xml;base64,','2025-07-23 02:19:19',2,1,1,30),(31,7,'Amstel 600ml','Cerveja Amstel 600ml – puro malte com leveza e sabor equilibrado.','Amstel é uma cerveja de puro malte com sabor leve, suave e refrescante. A garrafa de 600ml é ideal para dividir. Perfeita para qualquer ocasião, com equilíbrio e qualidade.',13.90,'data:image/svg+xml;base64,','2025-07-23 02:20:12',2,1,0,31),(32,8,'Moscow Mule','Vodka, gengibre e limão com espuma cremosa de gengibre.','Um clássico reinventado! Feito com vodka nacional, xarope de gengibre artesanal, suco de limão fresco e finalizado com uma cremosa espuma de gengibre. Refrescante e marcante, servido na caneca tradicional.',29.90,'data:image/jpeg;base64,','2025-07-23 02:21:47',1,1,1,32),(33,8,'Aperol Spritz','Aperol com espumante e toque de laranja cítrica.','Um drink leve e sofisticado, perfeito para dias quentes. Combina o amargor leve do Aperol com espumante gelado e uma fatia de laranja. Equilibrado e elegante.',29.90,'data:image/svg+xml;base64,','2025-07-23 02:22:39',1,1,1,33),(34,8,'Cozumel','Chopp com limão, gelo e borda de sal.','Refrescância e sabor em um só copo. O Cozumel leva chopp claro, limão espremido, muito gelo e uma borda de sal que intensifica o sabor. Ideal para os amantes de cerveja com um toque cítrico.',19.90,'data:image/svg+xml;base64,','2025-07-23 02:24:25',1,1,0,34),(35,8,'Red Gin','Gin com tônica e toque intenso de amora e canela.','Uma explosão de sabor! Gin nacional com água tônica, xarope artesanal de amora e um toque especial de canela. Aromático e levemente doce, perfeito para surpreender o paladar.',28.90,'data:image/svg+xml;base64,','2025-07-23 02:25:33',1,1,1,35),(36,8,'Drink Skina67sss','Vodka com frutas amarelas, peachtree e limão taiti.','O drink exclusivo da casa! Combina vodka nacional, licor Peachtree, redução de frutas amarelas e limão taiti. Um drink refrescante, equilibrado e cheio de personalidade.',28.90,'data:image/jpeg;base64,','2025-07-23 02:27:00',1,1,0,36),(37,4,'Moscow Mule – Happy Hour','Clássico gelado com vodka, gengibre e espuma.','Drink refrescante feito com vodka nacional, xarope natural de gengibre, suco de limão e finalizado com espuma de gengibre. Servido na caneca tradicional.',24.90,'data:image/svg+xml;base64,','2025-07-23 02:32:30',1,1,0,3),(38,4,'Red Gin – Happy Hour','Gin tônica com toque adocicado de amora e especiarias.','Combinação equilibrada de gin nacional, água tônica e um toque marcante de xarope de amora com canela, servida com gelo e apresentação charmosa.',23.90,'data:image/svg+xml;base64,','2025-07-23 02:33:12',1,1,0,4),(39,4,'Drink Skina67 – Happy Hour','Frutado e cítrico com vodka e peachtree.','Drink exclusivo da casa com vodka nacional, licor peachtree, redução artesanal de frutas amarelas e toque fresco de limão taiti. Leve e tropical.',23.90,'data:image/svg+xml;base64,','2025-07-23 02:34:04',1,1,0,2),(40,4,'Antarctica 600ML – Happy Hour','Cerveja leve e tradicional, sempre gelada.','Antarctica 600ml, ideal para compartilhar. Refrescância e leveza que combinam com qualquer momento do seu happy hour.',9.90,'data:image/svg+xml;base64,','2025-07-23 02:34:45',2,1,1,0),(41,4,'Batata Rústica com Bacon e Cheddar – Happy Hour','Crocante por fora, cremosa por dentro.','Batatas rústicas douradas, cobertas com bacon crocante e generosa camada de queijo cheddar cremoso. Perfeita para dividir.',22.90,'data:image/svg+xml;base64,','2025-07-23 02:35:56',2,1,0,1);
